/* Appwide Stuff */


.onoffswitch {
    position: relative; width: 90px;
    -webkit-user-select:none; -moz-user-select:none; -ms-user-select: none;
		display: inline-block;
		top: 6px;
}

.onoffswitch-checkbox {
    display: none;
}
.onoffswitch-label {
    display: block; overflow: hidden; cursor: pointer;
    border: 2px solid #e5e5e5; border-radius: 20px;
		padding: 0;
}

.onoffswitch-inner {
    display: block; width: 200%; margin-left: -100%;
    transition: margin 0.3s ease-in 0s;
}

.onoffswitch-inner:before, .onoffswitch-inner:after {
    display: block; float: left; width: 50%; height: 16px; padding: 0; line-height: 16px;
    font-size: 10px; color: white;
    box-sizing: border-box;
}

.object_onoffswitch-inner:before {
    content: "Show Objects";
    padding-left: 6px;
    background-color: #34A7C1; color: #FFFFFF;
}
.object_onoffswitch-inner:after {
    content: "List Objects";
    padding-right: 10px;
    background-color: #EEEEEE; color: #3f3f3f;
    text-align: right;
}

div#imageSourceSwitchContainer {
	display: inline-block;
}

.image_onoffswitch-inner:before {
    content: "Local";
    padding-left: 24px;
    background-color: #34A7C1; color: #FFFFFF;
}
.image_onoffswitch-inner:after {
    content: "Remote";
    padding-right: 22px;
    background-color: #EEEEEE; color: #3f3f3f;
    text-align: right;
}


.onoffswitch-switch {
    display: block; width: 6px; margin: 5px;
    background: #FFFFFF;
    position: absolute; top: 0; bottom: 0;
    right: 70px;
    border: 2px solid #fff; border-radius: 20px;
    transition: all 0.3s ease-in 0s;
}

.onoffswitch-checkbox:checked + .onoffswitch-label .onoffswitch-inner {
    margin-left: 0;
}
.onoffswitch-checkbox:checked + .onoffswitch-label .onoffswitch-switch {
    right: 0px;
}

	-moz-opacity: 0;
	opacity: 0;
	-webkit-transition: all 0.5s ease-out 1s;
	-moz-transition: all 0.5s ease-out 1s;

	-o-transition: all 0.5s ease-out 1s;
	transition: all 0.5s ease-out 1s;
}

div#o2_navButtonContainer_top{
	padding-bottom: 15px;
}



.o2_passageUrn:hover:before{
	/* content: "⚭"; */
	width: 2em;
	position:absolute;
	left: -1em;
	font-size: 150%;
	color: #7273af;
}

.o2_passageUrn {
	color: rgb(171, 0, 0);
	font-size: 80%;
	padding-bottom: 3px;
	margin-right: 4px;
	margin-left: 4px;
	vertical-align: baseline;
  position: relative;
  top: -0.4em;
}

/* Drop Down Menu Stuff */

.dropdown {
	position: relative;
	margin-left: -1px;
    display: inline-block;
    border-top: 1px solid #eee;
    border-left: 1px solid #ddd;
    border-right: 1px solid #bbb;
    border-bottom: 1px solid #aaa;
    width: 50%;
    padding-left: 13px;
    padding-right: 12px;
}

.dropdown.empty {
		border: 1px solid #eee;
		color: #ccc;
}

.dropdown.empty:before, .dropdown.empty:hover:before {
	content: "▲";
	color: #eee;
}

.dropdown.empty:hover {
	background-color: #d1e7f8;
}

.dropdown:hover {
	background-color: #d1e7f8;
	border-bottom: 1px solid #f8f8f8;
}

.dropdown:before {
	content: "▲";
	color: rgb(96, 160, 236);
}

.dropdown:hover:before {
	content: "▼";
	color: rgb(96, 160, 236);
}

.dropdown-content {
    display: none;
		font-size: 80%;
    position: absolute;
		left: -1px;
    background-color: #f8f8f8;
		border-top: 1px solid #f8f8f8;
    border-left: 1px solid #ddd;
    border-right: 1px solid #bbb;
    border-bottom: 1px solid #aaa;
    min-width: 220px;
    /* box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.3); */
    width: 300px;
		/*
    padding-left: 12px;
    padding-right: 12px;
		*/
    z-index: 1;
}

.dropdown-content p {
	padding: 3px 15px ;
	line-height: 1.2em;
}

.dropdown-content p:hover {
	background-color: #ededed;
}

.dropdown-content p:active {
	background-color: rgba(50, 161, 52, 0.2);
}

.dropdown.empty:hover .dropdown-content {
		display: none;
}

.dropdown:hover .dropdown-content {
    display: block;
}


/* Forms Stuff */

label {
	padding-right: 2px;
	padding-left: 4px;
	color: #333;
}

input[type=submit]:active {
		color: navy;
}

input[type=submit]:hover {
		color: green;
}

/* OpenSeadragon Guides CSS */
.osd-guide {
  z-index: 0;
  cursor: pointer;
  pointer-events: none;
}

.osd-guide-line {
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  bottom: 0;
  transform-origin: center;
  pointer-events: auto;
}

.osd-guide-horizontal {
  position: absolute;
  left: 50% !important;
  height: 2px !important;
  width: 150% !important;
  cursor: row-resize;
  transform: translateX(-50%);
}

.osd-guide-horizontal .osd-guide-line {
  border-top: 3px solid #fff600;
}

.osd-guide-vertical {
  position: absolute;
  top: 50% !important;
  height: 150% !important;
  width: 2px !important;
  cursor: col-resize;
  transform: translateY(-50%);
}

.osd-guide-vertical .osd-guide-line {
  border-left: 3px solid #D262F1;
}



/* Experimenting with pure-CSS tabs */

.app_tabs {
  position: relative;

.app_tab {
  float: left;

	height: 1.2em;
  background: #f7f7f7;
	color: #d7d7d7;
  padding: 9px;
	padding-top: 8px;
  border: 1px solid #ccc;
  border-bottom: 2px solid #f4f4f4;
  margin-left: -1px;
  position: relative;
  left: 1px;
	-moz-border-radius: 0px;
	-webkit-border-radius: 5px 5px 0px 0px;
	border-radius: 5px 5px 0px 0px;
}

.app_tab [type=radio] {
  display: none;
}

.content {
  position: absolute;
  top: 28px;
  left: 0;
  background: white;
  right: 0;
  /* bottom: 0; */
  padding-left: 20px;
  padding-right: 20px;
	padding-top: 3px;
	padding-bottom: 15px;
  border: 1px solid #ccc;
  display: none;
}

[type=radio]:checked ~ label {
  background: white;
	color: black;
  border-bottom: 3px solid white;
  z-index: 2;
}

[type=radio]:checked ~ label ~ .content {
  z-index: 1;
	display: block;
}

/* OpenSeadragon Guides CSS */
.osd-guide {
  z-index: 0;
  cursor: pointer;
  pointer-events: none;
}

.osd-guide-line {
  position: absolute;
  left: 0;

  pointer-events: auto;

  height: 2px !important;
  width: 150% !important;
  cursor: row-resize;
  transform: translateX(-50%);
}

.osd-guide-horizontal .osd-guide-line {
  border-top: 3px solid #D262F1;
}

	display: block;

	border-bottom: 2px dotted black;
}

}

	color: #09f;
}

	content: "( ";
}

choice:after {
	content: " )";
}

corr {
	color: green;

}


del {

}

}

	content: "(";
}

	content: ")";
}

gap:before {
	content: " […] ";
}

q:before {
	content: "“";
}

	content: "”";
}

quote:before {
	content: "“";
}

ref {

}

	content: "”";
}

w {

}

}

	content: "[";
}

	content: "]";
}

speaker {
	font-weight: bold;
}

speaker:after {
	content: " — ";
